import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int k = sc.nextInt();
        int[] arrayA = new int[n];

        for (int i = 0; i < n; i++) {
            arrayA[i] = sc.nextInt();
        }

        int[] bits = new int[n];
        int count = 0;
        while (true) {
            int index = 0;
            for (;index < n; index++) {
                if (bits[index] == 0) {
                    bits[index] = 1;
                    break;
                } else {
                    bits[index] = 0;
                }
            }
            if (index == n) break;
            count += (checkSubset(bits, k, arrayA)) ? 1 : 0;
        }
        System.out.println(count);
    }

    public static boolean checkSubset(int[] bits, long sum, int[] array) {
        long temptSum = 0;
        for (int i = 0; i < array.length; i++) {
            if (bits[i] == 1) {
                temptSum+= array[i];
            }
        }
        return (temptSum == sum);
    }
}
